import React from 'react';
import {Link} from "react-router-dom";
import '../styles/Navbar.css';

const navbar = () => {
  return (
    <div className='navBg'>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <Link to="/projects">Projects</Link>
      <Link to="/contact">Contact</Link>
    </div>
  )
}

export default navbar;
